import PropTypes from 'prop-types';
import React, { useEffect, useRef, useCallback } from 'react';
import * as d3 from 'd3';
import qs from 'qs';
import useResizeObserver from './useResizeObserver';
import bn from '../../utils/bemnames';
import Card from './Card';
import PathsConstant from '../../constants/PathsConstant';
import { history } from '../../utils/navigation-util';
import ErrorBoundary from './ErrorBoundary';

const bem = bn.create('interlocking');

const D3InterlockingDirectors = (props) => {
  const ref = useRef(null);
  const dimensions = useResizeObserver(ref);
  const query = qs.parse(history.location.search, { ignoreQueryPrefix: true });

  const drag = (force) => {
    function dragstarted(event) {
      if (!event.active) force.alphaTarget(0.3).restart();
      event.subject.fx = event.subject.x;
      event.subject.fy = event.subject.y;
    }

    function dragged(event) {
      event.subject.fx = event.x;
      event.subject.fy = event.y;
    }

    function dragended(event) {
      if (!event.active) force.alphaTarget(0);
      event.subject.fx = null;
      event.subject.fy = null;
    }

    return d3
      .drag()
      .on('start', dragstarted)
      .on('drag', dragged)
      .on('end', dragended);
  };

  const interlockingGraph = useCallback(async (width, height) => {
    const ready = async () => {
      const restartTime = query.print ? 0 : 0.02;

      d3.select(ref.current).selectAll('*').remove();
      const svg = d3.select(ref.current).append('svg');
      const json = props.data;
      Object.preventExtensions(json.nodes);

      const force = d3
        .forceSimulation(json.nodes)
        .force('link', d3.forceLink().distance(75))
        .force('charge', d3.forceManyBody().strength(-3000))
        .force('center', d3.forceCenter(width / 2, height / 2))
        .force('x', d3.forceX(width))
        .force('y', d3.forceY(height))
        .alphaTarget(restartTime);
      json.nodes[0].fixed = true;
      Object.preventExtensions(json.nodes);

      force.nodes(json.nodes);
      force.force('link').links(json.links);
      force.alphaTarget(restartTime).restart();

      const link = svg
        .selectAll('.link')
        .data(json.links)
        .enter()
        .append('line')
        .attr('class', 'link')
        .attr('stroke', '#ccc');

      const node = svg
        .selectAll('.node')
        .data(json.nodes)
        .enter()
        .append('g')
        .attr('class', 'node')
        .call(drag(force));

      node.each(function (d) {
        if (d.className) {
          d3.select(this).classed(d.className, true);
        }
      });

      node.append('circle');

      svg
        .selectAll('.node.self')
        .append('image')
        .attr(
          'xlink:href',
          'data:image/png;base64,'
        )
        .attr('width', 80)
        .attr('height', 80)
        .attr('x', -40)
        .attr('y', -40);
      svg
        .selectAll('.node.director')
        .append('image')
        .attr(
          'xlink:href',
          'data:image/png;base64,'
        )
        .attr('width', 80)
        .attr('height', 80)
        .attr('x', -40)
        .attr('y', -40);
      svg
        .selectAll('.node.company')
        .append('image')
        .attr(
          'xlink:href',
          'data:image/png;base64,'
        )
        .attr('width', 80)
        .attr('height', 80)
        .attr('x', -40)
        .attr('y', -40);

      node
        .append('text')
        .attr('y', -10)
        .attr('dy', '.35em')
        .attr('text-anchor', 'middle')
        .text((d) => d.name)
        .call(wrapText, 60);

      node
        .append('a')
        .attr('xlink:href', (d) => {
          if (d.name.substring(0, 1) !== '*') {
            if (d.className === 'company') {
              return (
                PathsConstant.GOVERNANCE_OVERVIEW +
                PathsConstant.QUERY_PID +
                d.unique_id
              );
            }
            if (d.className === 'director') {
              return (
                PathsConstant.DIRECTORSHIP_AND_EXECUTIVE +
                PathsConstant.QUERY_DIRECTOR +
                d.unique_id
              );
            }
          }
        })
        .append('circle')
        .attr('class', 'clickable')
        .attr('dx', -40)
        .attr('x', (d) => (d.children || d._children ? -60 : 10))
        .attr('r', 40)
        .style('fill', 'black')
        .style('fill-opacity', 0.5);

      force.on('tick', () => {
        node
          .attr('cx', (d) => {
            d.x = Math.max(40, Math.min(width - 40, d.x));
          })
          .attr('cy', (d) => {
            d.y = Math.max(40, Math.min(height - 40, d.y));
          });
        const nodes = force.nodes();
        nodes[0].x = width / 2;
        nodes[0].y = height / 2;

        link
          .attr('x1', (d) => d.source.x)
          .attr('y1', (d) => d.source.y)
          .attr('x2', (d) => d.target.x)
          .attr('y2', (d) => d.target.y);

        node.attr('transform', (d) => `translate(${d.x},${d.y})`);
      });

      let safety = 0;
      while (force.alpha() > 0.005) {
        force.tick();
        if (safety++ > 50000) {
          break;
        }
      }
    };
    try {
      await ready();
    } catch (error) {
      console.log(error);
    }
  }, [props.data, dimensions, query.print]);

  useEffect(() => {
    if (dimensions !== null) {
      const height = 500;
      const { width } = dimensions; // || ref.current.getBoundingClientRect();
      interlockingGraph(width, height);
    }
  }, [interlockingGraph, dimensions]);

  const wrapText = (text, width) => {
    text.each(function () {
      const textEl = d3.select(this);
      const words = textEl.text().split(/\s+/).reverse();
      let word;
      let line = [];
      let linenumber = 0;
      const lineHeight = 1;
      const y = textEl.attr('y');
      const dx = parseFloat(textEl.attr('dx') || 0);
      const dy = parseFloat(textEl.attr('dy') || 0);
      let tspan = textEl
        .text(null)
        .append('tspan')
        .attr('x', 0)
        .attr('y', y)
        .attr('dy', `${dy}em`);

      while ((word = words.pop())) {
        line.push(word);
        tspan.text(line.join(' '));
        if (tspan.node().getComputedTextLength() > width) {
          line.pop();
          tspan.text(line.join(' '));
          line = [word];
          tspan = textEl
            .append('tspan')
            .attr('x', 0)
            .attr('y', y)
            .attr('dx', dx)
            .attr('dy', `${++linenumber * lineHeight + dy}em`)
            .text(word);
        }
      }
    });
  };

  return (
    <ErrorBoundary>
      <Card
        isComp={props.isComp}
        isInvest={props.isInvest}
        title={props.cardtitle}
        smalltitle={props.cardsmalltitle}
      >
        <div
          className={
            props.TrialUser
              ? bem.b('col-lg-offset-3 blurrytext')
              : bem.b('col-lg-offset-3')
          }
          style={{ height: '500px' }}
        >
          <div ref={ref} />
        </div>
      </Card>
    </ErrorBoundary>
  );
};

D3InterlockingDirectors.propTypes = {
  cardsmalltitle: PropTypes.string,
  cardtitle: PropTypes.string,
  data: PropTypes.object,
  isComp: PropTypes.bool,
  isDummyData: PropTypes.bool,
  isInvest: PropTypes.bool,
};

D3InterlockingDirectors.defaultProps = {
  cardsmalltitle: '',
  cardtitle: '',
  data: {},
  isComp: false,
  isDummyData: false,
  isInvest: false,
};

export default React.memo(D3InterlockingDirectors);
